/**
 * SVG资源路径类型(所有可用的资源路径字符串联合类型)
 */
type SVGResourcePath = keyof SVGResourceMap;

/**
 * SVG资源加载器接口
 */
interface SVGResourceLoader {
  /**
   * 根据资源路径动态加载SVG模块
   * @param path - SVG资源的相对路径
   * @returns 模块导出内容
   * @throws {Error} 当模块路径不存在时抛出MODULE_NOT_FOUND错误
   */
  (path: SVGResourcePath): unknown;

  /**
   * 获取所有可用的SVG资源路径列表
   * @returns 资源路径数组
   */
  keys(): SVGResourcePath[];

  /**
   * 将资源路径解析为模块ID
   * @param path - SVG资源的相对路径
   * @returns 模块ID(数字)
   * @throws {Error} 当模块路径不存在时抛出MODULE_NOT_FOUND错误
   */
  resolve(path: SVGResourcePath): number;

  /**
   * 当前模块的唯一标识符
   */
  readonly id: 349452;
}

/**
 * SVG资源加载器实例
 * 用于动态导入项目中的SVG图标资源
 */
declare const svgResourceLoader: SVGResourceLoader;

export = svgResourceLoader;